龙币”区。划拨的上限为“我的龙币”区的龙币。相对的，玩家也可以将“比倍龙币”区的龙币划拨入“我的龙币”区。当玩家猜中大小后，还可以再次划拨进行猜大小。</span> <span style=\"color:#f48700;\">赔率：以下为所有固定赔率物品的赔率。所有其他小的物品（小77、小樱桃、小西瓜、小石榴、小橙子、小柠檬、小苹果）为 1:2 ，苹果 1:5，柠檬 1:10，橙子 1:15，石榴 1:20，西瓜 1:25，樱桃 1:30，77 1:35，小BAR 1:20，大BAR 1:40 。</span> </pre><br/><br/>&nbsp;&nbsp;Remark=><span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;font-style:normal;font-weight:normal;line-height:24px;background-color:#FFFFFF;\">幸运水果机是一款街机游戏，游戏界面由24个方格拼接成一个正方形，每个方格中都有一个不同的水果图形，方格下都有一个小灯。玩家使用游戏币选择希望押注的目标，按下开始后，小灯开始绕着正方形中每个格子转。当小灯停下时，如果停在玩家押注的目标上则可赢取相应的游戏币。</span><br/><br/>submit=> 提 交 <br/><br/>','192.168.1.138','Firefox48.0','windows','','1473231748',3),(2915,'gameRoom','index','/zy_game_center/index.php?d=admin&c=gameRoom&m=index&per_page=0','','192.168.1.138','Firefox48.0','windows','','1473231890',3),(2916,'gameRoom','index','/zy_game_center/index.php?d=admin&c=gameRoom','','192.168.1.138','Firefox48.0','windows','','1473232046',3),(2917,'gameRoom','index','/zy_game_center/index.php?d=admin&c=gameRoom','','192.168.1.138','Firefox48.0','windows','','1473232197',3),(2918,'gameRoom','edit','/zy_game_center/index.php?d=admin&c=gameRoom&m=edit&RoomID=6','','192.168.1.138','Firefox48.0','windows','','1473232173',3),(2919,'gameRoom','save','/zy_game_center/index.php?d=admin&c=gameRoom&m=save','RoomID=>6<br/><br/>&nbsp;&nbsp;GameName=>幸运水果机<br/><br/>&nbsp;&nbsp;Folder=>fruit<br/><br/>&nbsp;&nbsp;GameType=>1<br/><br/>&nbsp;&nbsp;Status=>0<br/><br/>&nbsp;&nbsp;Version=>v1.0<br/><br/>&nbsp;&nbsp;ScreenImages=>Array<br/><br/>&nbsp;&nbsp;GameResume=><pre><span style=\"color:#f48700;\">游戏中的物品有八种，分别为：苹果、柠檬、橙子、石榴、西瓜、樱桃、双7，这些物品又分为大小两种，还有BAR图标，共有3种。 </span><span style=\"color:#f48700;\">正方形游戏区下方为押注区，押注区中列出各种物品和其相关的赔率。每种物品下方有“押注”按钮，每次点击增加1个龙币注金，每种物品的押注上限都为99。点击开始后跑灯停留在对应押注水果，则赢取的龙币是下注数乘以倍率。如果转到GoodLucky，系统会自动重新跑一次。 </span><span style=\"color:#f48700;\">猜大小，玩家中奖之后都可以进行猜大小，1-7 为小 ， 8-14为大。玩家可以点击“大”或者“小”按钮进行猜大小。如果猜中，则会赢取玩家在“比倍龙币”区中一样的龙币。玩家猜中大小之后仍然可以再次猜大小。</span> 