  `UID` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '管理用户UID',
  `Username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `TrueName` varchar(50) DEFAULT NULL COMMENT '姓名',
